    <>
        <Head>
            <title>NGO Example</title>
        </Head>
        <Header/>
    </>
    )
}

export async function getInitialProps() {
    console.log('hello')
    const client = Client();
    const doc = (await client.getSingle("home"))

    return {
        props: {
            doc
        },
    }
}

export default Index;
